import ReactDOM from 'react-dom';
import UserImage from "../images/user1.png";
import './card.css'
import StartLogo from "../images/start.png";

export default function Card(prop) {

    return (
        <div className='card'>
            <img src={UserImage} className='user-image' />
            <p className='all-items'><img src={StartLogo} className='star-logo' />
                <spam id='card-count'>  (6). &nbsp; </spam>
                <spam>{prop.title}</spam>
                <spam id='card-country'>USA</spam></p>
            <p className='card-tt'>From $136 / person</p>
        </div >
    );

}
